import { useState, useEffect } from "react";
import * as XLSX from "xlsx";
import { saveAs } from "file-saver";

const InvoicingDetail = () => {
  const [invoicingData, setInvoicingData] = useState([]);
  const [error, setError] = useState("");

  const [documentoFilter, setDocumentoFilter] = useState("");
  const [clienteFilter, setClienteFilter] = useState("");
  const [containerIdFilter, setContainerIdFilter] = useState("");

const numberFormatter = new Intl.NumberFormat("en-US", {
  minimumFractionDigits: 0,
  maximumFractionDigits: 0,
});

const [currentPage, setCurrentPage] = useState(1);
const itemsPerPage = 20;

const filteredData = invoicingData.filter((invoice) => {
  return (
    invoice.documento.toLowerCase().includes(documentoFilter.toLowerCase()) &&
    invoice.cliente.toLowerCase().includes(clienteFilter.toLowerCase()) &&
    invoice.container_id.toLowerCase().includes(containerIdFilter.toLowerCase())
  );
});

const paginatedData = filteredData
  .sort((a, b) => a.dt_documento.localeCompare(b.dt_documento))
  .slice((currentPage - 1) * itemsPerPage, currentPage * itemsPerPage);

const totalPages = Math.ceil(filteredData.length / itemsPerPage);

const goToPage = (page) => {
  if (page >= 1 && page <= totalPages) setCurrentPage(page);
};

const formatNumber = (value) =>
  typeof value === "number" ? numberFormatter.format(value) : "-";

const twoDecimalFormatter = new Intl.NumberFormat("en-US", {
  minimumFractionDigits: 2,
  maximumFractionDigits: 2,
});

const downloadExcel = () => {
  if (!invoicingData.length) return;

  // Create a worksheet from your data
  const worksheet = XLSX.utils.json_to_sheet(invoicingData);

  // Create a workbook and add the worksheet
  const workbook = XLSX.utils.book_new();
  XLSX.utils.book_append_sheet(workbook, worksheet, "Invoicing");

  // Generate a buffer
  const excelBuffer = XLSX.write(workbook, {
    bookType: "xlsx",
    type: "array",
  });

  // Create and save the blob
  const data = new Blob([excelBuffer], { type: "application/octet-stream" });
  saveAs(data, "invoicing_data.xlsx");
};


useEffect(() => {
  fetch("http://10.13.10.12:5001/api/invoicing")
    .then((res) => res.json())
    .then((data) => {
      console.log("📥 Received from API:", data);
      setInvoicingData(data);
    })
    .catch((err) => {
      console.error("❌ Fetch error:", err);
      setError("Error fetching data");
    });
}, []);

  return (
    <div>
      <h1>InvoicingDetail</h1>
      {/* Detail table */}
      <div className="invoicingData-list">
        {error && <div className="error-message">{error}</div>}
        <button onClick={downloadExcel} className="login-btn">
        📥 Download Excel
        </button>
        <div className="table-container">
          <table>
            <thead>
              <tr>
                <th>source</th>
                <th>empresa</th>
                <th>documento</th>
                <th>dt_documento</th>
                <th>item</th>
                <th>status</th>
                <th>cliente</th>
                <th>container_id</th>
                <th className="number-cell">qty</th>
                <th className="number-cell">fob_usd</th>
                <th className="number-cell">flete_usd</th>            
              </tr>
            </thead>
            <tbody>
              {paginatedData.map((invoice) => (
                <tr key={invoice.documento + invoice.item}>       
                    <td>{invoice.source}</td>
                    <td>{invoice.empresa}</td>
                    <td>{invoice.documento}</td>
                    <td>{invoice.dt_documento}</td>
                    <td>{invoice.item}</td>
                    <td>{invoice.status}</td>
                    <td>{invoice.cliente}</td>
                    <td>{invoice.container_id}</td>
                    <td className="number-cell">{twoDecimalFormatter.format(invoice.qty)}</td>
                    <td className="number-cell">{twoDecimalFormatter.format(invoice.fob_usd)}</td>
                    <td className="number-cell">{twoDecimalFormatter.format(invoice.flete_usd)}</td>
                  </tr>
                ))}
            </tbody>
          </table>
        </div>
      </div>
        {/* Pagination */}
        <div className="pagination">
            <button className="login-btn" onClick={() => goToPage(currentPage - 1)} disabled={currentPage === 1}>
                ⬅ Prev
            </button>
            <span>Page {currentPage} of {totalPages}</span>
            <button className="login-btn" onClick={() => goToPage(currentPage + 1)} disabled={currentPage === totalPages}>
                Next ➡
            </button>
        </div>
    </div>
  );
};

export default InvoicingDetail;
